import {
	BrowserRouter as Router,
	Switch,
	Route,
} from "react-router-dom"
import TodoList from "./routes/TodoList"
import Detail from "./routes/Detail";

const App = () => {
	return (
		<Router>
			<Switch>
			<Route path="/todo/:id">
				<Detail />
			</Route>
			<Route path="/">
				<TodoList />
			</Route>
			</Switch>
	  </Router>
	)
}

export default App;
